                                      />
                                    </InputAdornment>
                                  ),
                                }}
                                inputProps={{
                                  style: {
                                    fontWeight: "600",
                                    color:  styles.app_color,
                                  },
                                }}
                              />
                            </Grid>
                            <Grid item md={2.5}>
                              <TextField
                                size="small"
                                label="To"
                                value={`${trip5?.destination?.city_name || ""
                                  } ${trip5?.destination?.city_code || ""}`}
                                onClick={() => searchsources("t5d")}
                                className={classes1.search_root}
                                InputLabelProps={{
                                  style: {
                                    color:  styles.app_color,
                                  },
                                }}
                                InputProps={{
                                  startAdornment: (
                                    <InputAdornment position="start">
                                      <FlightLandIcon
                                        className={classes.iconscolor}
                                      />
                                    </InputAdornment>
                                  ),
                                }}
                                inputProps={{
                                  style: {
                                    fontWeight: "600",
                                    color:  styles.app_color,
                                  },
                                }}
                              />
                            </Grid>
                            <Grid
                              item
                              md={2}
                              ref={trip5?.calopen ? departref : returnref}
                            >
                              <TextField
                                size="small"
                                label="Departure Date"
                                autoComplete="off"
                                className={classes1.search_root}
                                value={trip5?.date ?? ""}
                                onClick={() =>
                                  setTrip5((prev) => ({
                                    ...prev,
                                    calopen: true,
                                  }))
                                }
                                InputLabelProps={{
                                  style: {
                                    color:  styles.app_color,
                                  },
                                }}
                                InputProps={{
                                  startAdornment: (
                                    <InputAdornment position="start">
                                      <CalendarMonthIcon
                                        className={classes.iconscolor}
                                      />
                                    </InputAdornment>
                                  ),
                                }}
                                inputProps={{
                                  style: {
                                    fontWeight: "600",
                                    color:  styles.app_color,
                                  },
                                }}
                              />
                              {trip5?.calopen && (
                                <Flightcalender
                                  selectdate={multicitydeparture}
                                  trip="5"
                                />
                              )}
                            </Grid>

                            <Grid item md={2} textAlign="right">
                              <Stack
                                direction="row"
                                onClick={removecities}
                                justifyContent="center"
                                alignItems="center"
                                spacing={1}
                                sx={{
                                  border: `1px solid ${styles.app_color}`,
                                  padding: "0.5rem 0.8rem",
                                  borderRadius: "0.5rem",
                                  borderColor: "#D02626",
                                }}
                              >
                                <img src={Remove} alt="add" />
                                <span
                                  style={{
                                    color: "#D02626",
                                    fontSize: "14px",
                                    fontWeight: "600",
                                  }}
                                >
                                  Remove
                                </span>
                              </Stack>
                            </Grid>
                          </Grid>
                        </Grid>
                      )}
                    </Stack>
                  </AccordionDetails>
                </Accordion>
              </Stack>
            </TabPanel>
          </TabContext>
        </Paper>
      </Container>
    </div>
  );
};

export default FlightsSearch;
